import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { ProjectComponent } from './project/project.component';
import { ProjectResolver } from './guards/project.resolver';
import { ProjectFormComponent } from './project-form/project-form.component';

const routes: Routes = [
  {path:'',component:ProjectComponent},
  {path:'projeto',component:ProjectComponent  },
  {path:'novo',component:ProjectFormComponent  },
  {path:'editar/:id',component:ProjectFormComponent , resolve:{project:ProjectResolver} },

];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule]
})
export class ProjectRoutingModule { }
